        const { name,email,Food,Why_is_Fav} = this.props.userFavFood;
        return (
            <div>
                <h1>{name}</h1>
                <h3>Email: {email}</h3>
                <h4>Name of Favorite Food: {Food}</h4>
                <p> Why is their Fav : {Why_is_Fav} </p>
            </div>
        );
    }
}

export default Info;

